Step-by-step reasoning:
1. We assume that responders evaluate offers by comparing the proposed share (split_self) to what would be considered a fair share. The fair share is computed from the proportional contribution computed from token_self and token_opp. In monetary terms, the fair share for the participant is given by (combined_earning × token_self / (token_self + token_opp)).
2. The key psychological mechanism is sensitivity to fairness: if the offered money (split_self) exceeds the fairness norm, the offer is more likely to be accepted. Conversely, if the offer is lower than the fairness norm, rejection is more likely.
3. We capture this mechanism mathematically by defining a fairness discrepancy: (split_self – fair_share) where fair_share = combined_earning × token_self/(token_self + token_opp).
4. We then use a linear combination, adding an intercept (bias), to compute an internal utility value. This utility is converted to a binary choice probability via the logistic function.
5. The resulting model is: 
  Utility, U = bias + lambda_f × (split_self – (combined_earning × token_self/(token_self+token_opp))).
  The probability of accepting the offer is then given by P(accept=1) = 1/(1 + exp(–U)).
6. Two learnable parameters (bias and lambda_f) are used, each with generous finite bounds, to keep the total number of parameters small and reduce potential covariance.

Below is the formal specification.

<MODEL>
U = bias + lambda_f * ( split_self - (combined_earning * token_self / (token_self + token_opp) ) )
</MODEL>

